import Card, {
  PinkCard,
  InfoPackWithButton,
  TopBar,
  BottomBar,
  PhishingExamples,
  Facts,
} from "./Components.js";
import "./App.css";
import { useNavigate } from "react-router-dom";
import { useState, useEffect } from "react";
import React from "react";

function PhishingScreen() {
  const navigate = useNavigate();

  const [isMobile, setIsMobile] = useState(window.innerWidth < 768);

  useEffect(() => {
    const handleResize = () => setIsMobile(window.innerWidth < 768);
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  return (
    <>
      <TopBar />
      <Facts
      source={"https://www.cisco.com/c/en/us/products/security/secure-access/phishing-for-dummies.html"}
        title={<>Facts About Phishing</>}
        content={
          <>
            <li>1 in every 99 emails is a phishing attack.</li>
            <li>30% of phishing attacks are opened.</li>
          </>
        }
      />
      <PhishingExamples />
      
      <div
        style={{
          border: "none",
          justifyContent: "center",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          maxWidth: "fit-content",
          borderRadius: "17px",
          margin: "30px auto",
          minHeight: "750px",
          height: "auto",
          padding: "30px 20px",
          boxShadow: "0px 4px 5px rgba(0, 0, 0, 0.3)",
        }}
      >
        <h1 style={{ fontSize: "45px", textAlign: "left", width: "100%" }}>
          To protect yourself from phishing{" "}
        </h1>
        <InfoPackWithButton
          picture={"At sign.png"}
          title={<>Check the email address of the sender</>}
          description={
            <>
              Before clicking any links or attachments and before responding to
              an email, check the sender's name and email address to ensure it
              is an email from someone you know.
            </>
          }
        />
        <InfoPackWithButton
          picture={"Icon.png"}
          title={<>Is it urgent?</>}
          description={
            <>Be suspicious of emails and messages that claim to be urgent.</>
          }
        />
        <InfoPackWithButton
          picture={"fluent-mdl2_spelling.png"}
          title={<>Check the grammar and spelling of the email</>}
          description={
            <>
              If there are any spelling or grammar mistakes, it is a sign it is
              a phishing attempt.
            </>
          }
        />
        <InfoPackWithButton
          picture={"fluent_person-key-24-regular.png"}
          title={<>Do not provide personal information</>}
          description={
            <>
              Never provide your information when requested via email, text, or
              instant messaging.
            </>
          }
        />
        <InfoPackWithButton
          picture={"mdi_spy.png"}
          title={<>Do not give a stranger access to your devices</>}
          description={
            <>Do not loan a stranger your phone, laptop, or any other device.</>
          }
        />
        <InfoPackWithButton
          picture={"Link.png"}
          title={<>Do your best to not click any links in the email</>}
          description={
            <>
              When receiving emails from known institutions (the government,
              your bank, your doctor), go directly to the source instead of
              clicking on links in the email.
            </>
          }
        />
      </div>
      <div
        className="resources-part-styling"
        style={{
          justifyContent: "center",
          paddingTop: "20px",
          paddingBottom: "60px",
        }}
      >
        <h1>Related Topics</h1>
        <div className="pinkcard-row-styling">
          <PinkCard
            title={
              <>
                Setting up 2-Factor
                <br />
                Authentication
              </>
            }
            content={
              <>
                Keep your account safe with
                <br />
                an extra security step.
              </>
            }
          />
          <PinkCard
            title={
              <>
                Creating a <br />
                password
              </>
            }
            content={
              <>
                Learn how to create a<br />
                strong, safe password.
              </>
            }
          />
          <PinkCard
            title={<>Phishing</>}
            content={
              <>
                A popular type <br />
                cyberattacks is phishing.
                <br />
                Learn how to protect
                <br />
                yourself.
              </>
            }
          />
        </div>
      </div>
      <BottomBar />
    </>
  );
}

export default PhishingScreen;
